import React from "react";
import "./style.scss";
import Slider from "../../components/Slider";
import Checkbox from "../../components/CheckboxHome";
import CheckboxFilter from "../../components/CheckboxFilter";
import CheckboxCondition from "../../components/CheckboxCondition";

import { Container, Row, Col } from "react-bootstrap";
function Main() {
  return(

      <Container className="fondo">
          <Row>
            <Col className="a1">
              <CheckboxHome />
            </Col>
            <Col className="a2">1</Col>
            <Col className="a3">1</Col>
            <Col className="a4">1</Col>
          </Row>
          <Row>
            <Col>
              <CheckboxCondition />
            </Col>
            <Col>
              <Slider />
            </Col>
            <Col>1</Col>
            <Col>
              <CheckboxFilter />
            </Col>
          </Row>
      </Container>

  );
}

export default Main;
